window.bookSummaryJSON = "<p>What the hell is she doing in my strip club?</p> <p>She wasn’t supposed to be a stripper.</p> <p>She was the new waitress, but when she got up on stage, I couldn’t take my eyes off her. </p> <p>And when she started to strip, I had to keep my jaw from hitting the damn floor.</p> <p>Sorry, I’m not touching her.</p> <p>I’m not the man she once loved.</p> <p>She has no business being in a place like this - or with a man like me.</p> <p>She’s pure and innocent, I’ve got more demons than hell itself.</p> <p>I thought I was prepared for anything.</p> <p>But nothing prepared me for her.</p> <p>Now the darkness is closing in, and it’s too late to run.</p> <p>One night.</p> <p>That’s all I want.</p> <p>That’s all I need.</p> <p>She will carry my baby.</p> <p>Because only I can protect her.</p> <p>Even if nothing will protect her from the evil inside me.</p> <p>Not even myself.</p> <p>She's daring the devil - what the hell did she think would happen?</p> <p>MC biker president. A shit ton of tattoos. Feared, uncompromising, possessive. From <i>USA Today</i> best-selling author Jolie Day comes <i>Vorn</i>, a stand-alone MC romance. All books in the series are stand-alones, no cliff-hanger. Only for mature listeners. Contains graphic language and explicit adult content.</p>"; 
